function drawText(x,y, text){
	textElement = document.createElementNS('http://www.w3.org/2000/svg', 'text');
	textElement.setAttribute('x', x); // X-coordinate of the text
	textElement.setAttribute('y', y); // Y-coordinate of the text
	textElement.setAttribute('font-size', '3'); // Font size
	textElement.setAttribute('fill', 'black'); // Fill color
	textElement.textContent = text; // Text content
	svg.appendChild(textElement);
}

function midpoint(x1, x2){
  return (x1+x2) /2 ;
}

function drawHepKawung(Points){
	// Get Center of Heptagonal Kawung
	xc = 0;
	yc = 0;
	for (let i=0; i < Points.length; i++){
		xc += Points[i].x;
		yc += Points[i].y;
	}
	xc = xc / Points.length;
	yc = yc / Points.length;
	// drawText(xc , yc, "O");

	for (let i=0; i < Points.length ; i++){
	if (i < Points.length -1) {
    	new_x = midpoint(Points[i].x,Points[i+1].x);
    	new_y = midpoint(Points[i].y, Points[i+1].y);
	}
	else {
	    new_x = midpoint(Points[i].x,Points[0].x);
    	new_y = midpoint(Points[i].y, Points[0].y);		
	}

	if (i === 0){
	new_x2 = midpoint(Points[i].x,Points[Points.length -1].x);
    new_y2 = midpoint(Points[i].y, Points[Points.length -1].y);	
	}
	else {
	new_x2 = midpoint(Points[i].x,Points[i -1].x);
    new_y2 = midpoint(Points[i].y, Points[i -1].y);	

	}

    // Quadratic Bezier Curve
    kawung_part = document.createElementNS("http://www.w3.org/2000/svg", "path");
    kawung_part.setAttribute("d", `M ${xc} ${yc} Q${new_x} ${new_y} ${Points[i].x} ${Points[i].y} Q${new_x2} ${new_y2} ${xc} ${yc}`);
    kawung_part.setAttribute("stroke", secondary_colour);
    kawung_part.setAttribute("fill", main_colour);
    svg.appendChild(kawung_part);

    // Circle 
    circle = document.createElementNS("http://www.w3.org/2000/svg", "circle");
    circle.setAttribute("cx", xc + 0.85 * (Points[i].x - xc)); // x-coordinate of the center
    circle.setAttribute("cy", yc + 0.85 * (Points[i].y - yc)); // y-coordinate of the center
    circle.setAttribute("r", 0.05 * Math.sqrt(  (Points[i].x - xc) ** 2 + (Points[i].y - yc) ** 2));   // radius
    circle.setAttribute('stroke', secondary_colour);
    circle.setAttribute("fill", secondary_colour); // fill color
    svg.appendChild(circle);

    circle = document.createElementNS("http://www.w3.org/2000/svg", "circle");
    circle.setAttribute("cx", xc + 0.7 * (Points[i].x - xc)); // x-coordinate of the center
    circle.setAttribute("cy", yc + 0.7 * (Points[i].y - yc)); // y-coordinate of the center
    circle.setAttribute("r", 0.03 * Math.sqrt(  (Points[i].x - xc) ** 2 + (Points[i].y - yc) ** 2));   // radius
    circle.setAttribute('stroke', secondary_colour);
    circle.setAttribute("fill", secondary_colour); // fill color
    svg.appendChild(circle);

	}
}



